// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./Comptroller.sol";
import "./GoodLottery.sol";

contract WishApi {
    Comptroller comptroller;

    struct GoodInfo {
        uint goodId;
        uint goodValue;
        uint256 publishTime;
        uint256 lockedTime;
        uint256 maintenanceFee;
        uint256 joinedUsers;
        uint ticketCounts;
        uint balance;
        address winner;
        string goodHash;
        uint stage;
        uint paybackFee;

        uint winnerTime;
        uint winnerBlock;
        uint winnerIndex;
    }

    struct UserJoinRecord {
         address user;
         uint count; 
         bool joined; 
         uint joinTime;
         uint joinBlockNum;
    }

    constructor(Comptroller _comptroller) {
        comptroller = _comptroller;
    }

    function getGoodsLength() public view returns (uint len) {
        return comptroller.getGoods().length;
    }


    function getGoodInfo(uint index) public view returns (GoodInfo memory good) {
        GoodLottery[] memory goodContracts = comptroller.getGoods(); 
        if(index >= goodContracts.length) return good;

        good.goodId = goodContracts[index].goodId();
        good.goodValue = goodContracts[index].goodValue();
        good.publishTime = goodContracts[index].publishTime();
        good.lockedTime = goodContracts[index].lockedTime();
        good.maintenanceFee = goodContracts[index].maintenanceFee();
        good.joinedUsers = goodContracts[index].getUsers().length;
        good.ticketCounts = goodContracts[index].getTickets().length;
        good.balance = comptroller.token().balanceOf(address(goodContracts[index]));
        good.winner = goodContracts[index].winner();
        good.goodHash = goodContracts[index].goodHash();
        good.stage = uint(goodContracts[index].stage());
        (uint winnerBlock, uint winnerTime, uint tickIndex) = goodContracts[index].winnerTime();
        good.winnerTime = winnerTime;
        good.winnerBlock = winnerBlock;
        good.winnerIndex = tickIndex;

        return good;
    }

    function getUserTickets(uint index, address user) public view returns (uint[] memory) {
        GoodLottery[] memory goodContracts = comptroller.getGoods(); 
        if(index >= goodContracts.length) return new uint[](0); 
        GoodLottery good = goodContracts[index];
        (address u, uint count, bool joined, uint joinTime, uint joinBlockNum) = good.userMapping(user);
        if (!joined || count == 0) {
            return new uint[](0);
        }

        address[] memory tickets = good.getTickets();
        uint[] memory ticketIds = new uint[](count);

        uint j = 0;
        for (uint256 i = 0; i < tickets.length; i++) {
            if(tickets[i] == user) {
                ticketIds[j] = i;
                j ++;
            }
        }
        return ticketIds;
    }

    function getUserRecord(uint index, uint num) public view returns (UserJoinRecord memory record) {
        GoodLottery[] memory goodContracts = comptroller.getGoods(); 
        if(index >= goodContracts.length) return record; 
        GoodLottery good = goodContracts[index];
        address addr = good.userList(num);
        if(addr != address(0)) {
          (address user, uint count, bool joined, uint joinTime, uint joinBlockNum) = good.userMapping(addr);
          record.user = user;
          record.count = count;
          record.joined = joined;
          record.joinTime = joinTime;
          record.joinBlockNum = joinBlockNum;
        }

        return record;
    }


    function getUserHistory(address user) public view returns (UserJoinRecord[] memory record) {
         GoodLottery[] memory goodContracts = comptroller.getGoods(); 

         record = new UserJoinRecord[](goodContracts.length);
         uint j = 0;
         for (uint256 i = 0; i < goodContracts.length; i++) {
              (address user, uint count, bool joined, uint joinTime, uint joinBlockNum) = goodContracts[i].userMapping(user);
              if(joined && count > 0) {
                record[j] = UserJoinRecord(user, count, joined, joinTime, joinBlockNum);
              }

         }
         return record;
    }

}
